const mapSize = [800, 800];
const snakeSpawnPos = [
  [8, 7],
  [8, 8]
];
const appleSpawnPos = [8, 3];
const mapScale = 30;
const speed = 100;
const compass = {
  38: [0, -1], // up
  40: [0, 1], // down
  37: [-1, 0], // left
  39: [1, 0], // right
  87: [0, -1], // up
  83: [0, 1], // down
  65: [-1, 0], // left
  68: [1, 0] // right
};

export {
  mapSize,
  snakeSpawnPos,
  appleSpawnPos,
  mapScale,
  speed,
  compass
};
